import React, { Component } from 'react';
import search from '../../assets/icons/search-solid.svg';

class Footer extends Component {
    render() {
        return (
            <div className='footer'>
                <p className='footer__text'>FAQ - PERGUNTAS FREQUENTES</p>
                    <input className='footer__' type='text' placeholder='Busque por termo...'></input>
                    <a className='footer__busca'>
                    <p button value="pesquisar" image={search}></p>
                
                    <p className='footer__text2'>buscar</p>
                    </a>
            </div>
        );
    }
}
export default Footer;
